informacaoComplementar:
A DISPENSA ELETRÔNICA Nº 07/2024 (NÚMERAÇÃO NO SISTEMA 90005/2024) teve como resultado a dispensa fracassada, conforme relatório da dispensa eletrônica em anexo (0840317);
Considerando que a INSTRUÇÃO NORMATIVA SEGES/ME Nº 67, DE 8 DE JULHO DE 2021, no art. 22, possibilita que a Administração em caso de dispensa deserta ou fracassada possa valer-se, para a contratação, de proposta obtida na pesquisa de preços que serviu de base ao procedimento, se houver, privilegiando-se os menores preços, sempre que possível, e desde que atendidas às condições de habilitação exigidas;
Considerando que, dada a possibilidade legal citada acima, Administração contratou a proposta de menor valor obtida na pesquisa de preços que serviu de base ao procedimento;
Considerando que a informação da escolha do fornecedor não foi possível de ser realizada dentro do sistema do COMPRASGOV, o sistema não permitiu informar o contrato no PNCP.
Dessa forma, procedemos nesta data com o cadastramento do resultado da contratação, para fins de publicação do contato no PNCP.

